import React from 'react'

export default function CanvasButton(props){
  let icon = `fas fa-${props.icon} fa-lg`
  let color = props.color;
  let inlineStyle = {
    background: color,
    padding:"20px"
  }
  return <button style={inlineStyle} className="canvas-button" onClick={props.onClick}>
    <i class={icon}></i>
  </button>
}
